import React, { useContext } from 'react'
import { TodoContext } from '../contexts/TodoContext'

const TodoList = () => {
	const { todos } = useContext(TodoContext)

	return (
		<ul>
			{todos.map((todo) => {
				return <li key={todo.id}>{todo.text}</li>
			})}
		</ul>
	)
}

export default TodoList
